<SUMMARY>
A multiplicative utility model for responder acceptance decisions. Utility is calculated as the ratio of the responder's monetary gain to an aspiration level. The aspiration level is a learnable parameter and is scaled by a factor that depends on the relative contributions of the responder and the opponent.  The model also uses a learnable parameter to modulate the impact of self-interest.
</SUMMARY>
